# Function to calculate the maximum nesting depth of parentheses in a group
def max_nesting_depth(group: str) -> int:
    depth = 0
    max_depth = 0
    for char in group:
        if char == '(':
            depth += 1
            if depth > max_depth:
                max_depth = depth
        elif char == ')':
            depth -= 1
    return max_depth

# Calculate the maximum nesting depth for each group and return as a list
return [max_nesting_depth(group) for group in groups]

