def get_next_positions(row, col):
    next_positions = []
    for dr, dc in directions:
        new_row = row + dr
        new_col = col + dc
        if 0 <= new_row < N and 0 <= new_col < N:
            next_positions.append((new_row, new_col))
    return next_positions

# Helper function to perform DFS and find the lexicographically smallest path
def dfs(current_pos, path, visited):
    row, col = current_pos
    if len(path) == k:
        return path
    visited.add(current_pos)
    for next_pos in get_next_positions(row, col):
        if next_pos not in visited:
            new_path = dfs(next_pos, path + [grid[next_pos[0]][next_pos[1]]], visited)
            if new_path and (not path or new_path < path):
                path = new_path
    visited.remove(current_pos)
    return path

